import React from 'react';
import { Spinner } from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css'
import '../css/Loading.css'

const Loading = () => {
    return (
        <div className="loader">
            <Spinner color="light" size='45%'></Spinner>
        </div>
    )
}

export default Loading;
